class Counter extends Component{
	state = {
		count: 0,
	};
	render(){
		return (
			<React.Fragment>
				<span>{document.getElementById("butt")}</span>
				<br/>
				<button id="butt">Increment</button>
			</React.Fragment>
		);
	}
}

export default Counter;
